### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Right-Angled Triangle Geometry**
- **Concepts:** Base, height, area of a triangle.
- **Equations:**
  - Area of a right-angled triangle: \( \text{Area} = \frac{1}{2} \times \text{base} \times \text{height} \)

#### 2. **Limits and Greatest Integer Function**
- **Concepts:** Limits, greatest integer function \( \lfloor x \rfloor \).
- **Equations:**
  - \( \lim_{{x \to 2^+}} \lfloor x \rfloor = 2 \)
  - \( \lim_{{x \to 2^-}} \lfloor x \rfloor = 1 \)

#### 3. **Systems of Linear Equations**
- **Concepts:** Unique solutions, no solutions, infinitely many solutions.
- **Equations:**
  - System I:
    \[
    \begin{cases}
    6x + 4y = 8 \\
    3x + 2y = -4
    \end{cases}
    \]
  - System II:
    \[
    \begin{cases}
    x + 3y + 5z = 14 \\
    4x - 2y - 6z = 6 \\
    -8x + 4y + 12z = -12
    \end{cases}
    \]

#### 4. **Quadratic Functions and Slopes**
- **Concepts:** Slope of a quadratic function, slope of a line.
- **Equations:**
  - Quadratic function: \( q(x) = ax^2 + 20x + 15 \)
  - Slope of \( q(x) \) at \( x = 2 \): \( q'(2) = 60 \)

#### 5. **Functional Equations**
- **Concepts:** Functional equations, exponential functions.
- **Equations:**
  - Functional equation: \( f(x + y) = f(x)f(y) \)
  - Solution: \( f(n) = 3^n \)

#### 6. **Area and Quadratic Equations**
- **Concepts:** Area of a rectangle, quadratic equations.
- **Equations:**
  - Total area: \( (7 + 2x)(5 + 2x) = 99 \)
  - Quadratic equation: \( 4x^2 + 24x + 35 = 99 \)

#### 7. **Page Rank Algorithm**
- **Concepts:** Importance scores, systems of linear equations.
- **Equations:**
  - System of linear equations for page rank:
    \[
    \begin{cases}
    6x_A - 3x_B - 2x_C = 0 \\
    3x_B - x_C - x_A = 0 \\
    3x_C - 3x_D - x_A = 0 \\
    6x_D - 2x_A - 3x_B - 2x_C = 0
    \end{cases}
    \]

#### 8. **Sequences and Limits**
- **Concepts:** Sequences, limits of sequences.
- **Equations:**
  - Sequence definition: \( a_n = a_{n-1} + \frac{1}{2^{n-1}} \)
  - Limit of the sequence: \( \lim_{n \to \infty} a_n = 2 \)

#### 9. **Continuity and Discontinuity of Functions**
- **Concepts:** Continuity, discontinuity, limits.
- **Equations:**
  - Piecewise function:
    \[
    f(x) =
    \begin{cases}
    \frac{x}{(x+1)(x+2)}, & x \geq 1 \\
    x - 5, & x < 1
    \end{cases}
    \]
  - Limit at \( x = 5 \): \( \lim_{x \to 5^+} f(x) = \lim_{x \to 5^-} f(x) = \frac{5}{42} \)

